import React from "react";
import { Typography } from "@mui/material";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";

const MedicalCodeSelector = ({
  availableCodes,
  selectedCodes,
  onDragEnd,
}) => {
  return (
    <div style={{ marginTop: "20px" }}>
      <Typography variant="h6">Drag & Drop Medical Codes</Typography>
      <DragDropContext onDragEnd={onDragEnd}>
        <div style={{ display: "flex", justifyContent: "space-between", gap: "16px" }}>
          {/* Available Codes */}
          <Droppable droppableId="available">
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                style={{
                  border: "1px solid gray",
                  padding: 10,
                  width: "45%",
                  minHeight: 100,
                  borderRadius: 4,
                }}
              >
                <Typography>Available Codes</Typography>
                {availableCodes.map((item, index) => (
                  <Draggable key={item.id} draggableId={item.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          padding: 8,
                          margin: "5px 0",
                          backgroundColor: "#e0f7fa",
                          borderRadius: 4,
                          ...provided.draggableProps.style,
                        }}
                      >
                        {item.code}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>

          {/* Selected Codes */}
          <Droppable droppableId="selected">
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                style={{
                  border: "1px solid gray",
                  padding: 10,
                  width: "45%",
                  minHeight: 100,
                  borderRadius: 4,
                }}
              >
                <Typography>Selected Codes</Typography>
                {selectedCodes.map((item, index) => (
                  <Draggable key={item.id} draggableId={item.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          padding: 8,
                          margin: "5px 0",
                          backgroundColor: "#dcedc8",
                          borderRadius: 4,
                          ...provided.draggableProps.style,
                        }}
                      >
                        {item.code}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </div>
      </DragDropContext>
    </div>
  );
};

export default MedicalCodeSelector;
